			shellScript = "productInfo=\"$BUILT_PRODUCTS_DIR/$INFOPLIST_PATH\"\nprojectInfo=\"$PROJECT_DIR/$INFOPLIST_FILE\"\n\n# Release模式下，更新Build号\nif [ ${CONFIGURATION} == \"Release\" ]; then\n# 记录Git提交次数，并设置为Build号\nbuildNumber=$(git rev-list HEAD | wc -l | tr -d ' ')\n/usr/libexec/PlistBuddy -c \"Set :CFBundleVersion $buildNumber\" \"${productInfo}\"\n/usr/libexec/PlistBuddy -c \"Set :CFBundleVersion $buildNumber\" \"${projectInfo}\"\nfi\n\n# 记录Git哈希码\ncommithash=$(git rev-parse --short HEAD)\nif [[ -n \"$commithash\" ]]; then\n# 如果这个属性不存在，则添加\n/usr/libexec/PlistBuddy -c \"Add :CommitHashString string $commithash\" \"${productInfo}\"\n# 如果这个属性存在，则更新它的值\n/usr/libexec/PlistBuddy -c \"Set :CommitHashString $commithash\" \"${productInfo}\"\nfi\n\n# 记录Git分支名\nbranchname=$(git rev-parse --abbrev-ref HEAD)\nif [[ -n \"$branchname\" ]]; then\n# 如果这个属性不存在，则添加\n/usr/libexec/PlistBuddy -c \"Add :BranchNameString string $branchname\" \"${productInfo}\"\n# 如果这个属性存在，则更新它的值\n/usr/libexec/PlistBuddy -c \"Set :BranchNameString $branchname\" \"${productInfo}\"\nfi\n\n# 记录Build时间\nbuilddate=`date`\nif [[ -n \"$builddate\" ]]; then\n# 如果这个属性不存在，则添加\n/usr/libexec/PlistBuddy -c \"Add :BuildDateString string $builddate\" \"${productInfo}\"\n# 如果这个属性存在，则更新它的值\n/usr/libexec/PlistBuddy -c \"Set :BuildDateString $builddate\" \"${productInfo}\"\nfi";
